import './App.css';
import {React} from "react";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link,
  Routes,
} from "react-router-dom";

function App() {
  return (
    <Routes>
        <Route path="/" element={<Home />} />
        <Route path="order" element={<OrderForm />} />
      </Routes>
  );
}

export default App;
